import { useEffect, useState } from "react";
import API from "../api";

export default function Participants() {
  const [participants, setParticipants] = useState([]);

  useEffect(() => {
    API.get("/participants")
      .then((res) => setParticipants(res.data))
      .catch((err) => console.log(err));
  }, []);

  return (
    <div className="p-8">
      <h1 className="text-3xl font-bold mb-4">ðŸ‘¤ Participants</h1>
      <table className="w-full border">
        <thead className="bg-gray-200">
          <tr>
            <th className="p-2 border">Name</th>
            <th className="p-2 border">College</th>
            <th className="p-2 border">Registration ID</th>
            <th className="p-2 border">Travel</th>
            <th className="p-2 border">Accommodation</th>
          </tr>
        </thead>
        <tbody>
          {participants.map((p) => (
            <tr key={p._id} className="border-b">
              <td className="p-2 border">{p.name}</td>
              <td className="p-2 border">{p.college}</td>
              <td className="p-2 border">{p.registration_id}</td>
              <td className="p-2 border">{p.travel_status}</td>
              <td className="p-2 border">{p.accommodation_status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
